def prime_fib(n: int) -> int:
    def is_prime(num: int) -> bool:
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    def prime_fib_helper(n: int, i: int = 0, j: int = 1) -> int:
        if is_prime(i):
            n += 1
            return prime_fib_helper(n, i + 1, j) * (i + 2) // 2
        else:
            return n

    return prime_fib_helper(n)
